import { StyleSheet } from "react-native";
const stylesNw = StyleSheet.create({
  container: {
    marginTop: 25,
    flexDirection: "column",
    display: "flex",
    backgroundColor: "#FFC232",
  },
  cardProduto: {
    display: "flex",
    flexDirection: "row",
    backgroundColor: "#FF7070",
    marginVertical: 5,
    marginHorizontal: 5,
    borderRadius: 20,
    height: 100,
    padding: 15,
    zIndex: 0,
  },
  cardText: {
    color: "#fff",
  },
  cardImage: {
    justifyContent: "space-between",
    borderRadius: 25,
    width: 100,
    height: 100,
    resizeMode: "cover",
  },
});
export { stylesNw };
